= 1 then            \n            aura_env.text:SetText(format(\"%i \\124cff%s+ %i\\124r\", aura_env.asp[1], after <= aura_env.asp[2] and \"00ff00\" or \"ff0000\", aura_env.inc));            \n        else\n            aura_env.text:SetText(format(\"\\124cff%s%s%i%s\\124r\", after <= aura_env.asp[2] and \"ffffff\" or \"ff0000\", after > aura_env.asp[2] and \"\" or \"\", after, after > aura_env.asp[2] and \"\" or \"\")); \n        end \n    else\n        aura_env.text:SetText(aura_env.asp[1]);        \n    end\nend\naura_env.updatePowerText();\n\n-- Predictive Casting\naura_env.generators = \n{\n    [190984] = 6,\n    [194153] = 8,\n    [202347] = 8,\n    [274281] = 10,\n    [274282] = 20,\n    [274283] = 40    \n}\n-- Casting Spark\nif aura_env.showPrediction then\n    aura_env.castProgress = 0\n    aura_env.predictCastBar = _G[\"balance-predict-cast\"] or aura_env.frame:CreateTexture(\"balance-predict-cast\", \"OVERLAY\");\n    aura_env.predictCastBar:SetWidth(aura_env.predictWidth);\n    aura_env.predictCastBar:SetHeight(aura_env.this:GetHeight() + 0.2);\n    aura_env.predictCastBar:SetPoint(\"LEFT\",aura_env.this.bar,\"RIGHT\", aura_env.castProgress, 0);\n    aura_env.predictCastBar:SetBlendMode(\"ADD\");\n    aura_env.predictCastBar:SetAlpha(aura_env.predictAlpha);\n    if not aura_env.sparkTexture then\n        aura_env.predictCastBar:SetColorTexture(1,1,1,1);\n    else\n        aura_env.predictCastBar:SetTexture(aura_env.sparkTexture);\n    end\n    aura_env.predictCastBar:Hide();\nend\n\n-- Cutaway/Fade Animation\nif aura_env.showSpendAnimation then\n    aura_env.cutaway = _G[\"wa-aspcutaway\"] or CreateFrame(\"StatusBar\", \"wa-aspcutaway\", aura_env.this)\n    aura_env.cutaway:SetHeight(aura_env.this:GetHeight())\n    aura_env.cutaway:SetPoint(\"LEFT\",aura_env.this.bar.fg,\"RIGHT\")\n    aura_env.cutaway:SetFrameStrata(\"MEDIUM\")\n    aura_env.cutaway:SetStatusBarTexture(aura_env.this.bar:GetStatusBarTexture());\n    aura_env.cutaway:Hide();\nelse\n    local r = _G[\"wa-aspcutaway\"];\n    if r then \n        r:Hide();\n    end    \nend\n\nif aura_env.showStarsurgeCost then\n    aura_env.starsurge = _G[\"wa-starsurge\"] or aura_env.frame:CreateTexture(\"wa-starsurge\", \"OVERLAY\")\n    aura_env.starsurge:SetSize(aura_env.starsurgeCostWidth, aura_env.this:GetHeight()+1)\n    aura_env.starsurge:SetTexture([[Interface\\AddOns\\WeakAuras\\Media\\Textures\\Square_White]])\n    aura_env.starsurge:SetVertexColor(0,0,0,1);\n    aura_env.starsurge:Show();\n    \n    local cost = GetSpellPowerCost(78674)[1].cost;\n    local barW = aura_env.this:GetWidth();   \n    local max = aura_env.asp[2];\n    --local powerPerPix = aura_env.asp[2] / barW;\n    local powerPerPix = barW / aura_env.asp[2];\n    local offset = cost * powerPerPix;\n    aura_env.starsurge:SetPoint(\"CENTER\", aura_env.this, \"LEFT\", offset, 0);\n    \nelse\n    local r = _G[\"wa-starsurge\"];\n    if r then \n        r:Hide();\n    end    \nend",
