						["custom"] = "function(allstates, event, ...)\n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        local timestamp, subEvent, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags, spellID, _,_, auraType = ...\n        if subEvent == \"SPELL_AURA_APPLIED\"\n        and spellID == 329205 then\n            aura_env.counter = aura_env.counter + 1\n            if destGUID == WeakAuras.myGUID then\n                local name, icon, count, _, duration, expirationTime = WA_GetUnitAura(\"player\", spellID, aura_env.auraType[auraType])\n                if name then\n                    local mark = GetRaidTargetIndex(destName)\n                    local icon = ICON_LIST[mark]\n                    allstates[destGUID] = {\n                        show = true,\n                        changed = true,\n                        progressType = \"timed\",\n                        duration = duration,\n                        expirationTime = expirationTime,\n                        counter = mark and mark < 9 and mark or 0,\n                        name = mark and mark ~= 0 and icon..\"12|t\"..mark..icon..\"12|t\" or \"Wave \"..aura_env.counter,\n                        unit = destName,\n                    }\n                    --PlaySoundFile(\"Interface\\\\AddOns\\\\SharedMedia_Causese\\\\sound\\\\\"..aura_env.counter..\".ogg\", \"MASTER\")\n                    return true\n                end\n            end\n        end\n        if subEvent == \"SPELL_AURA_REMOVED\"\n        and spellID == 329205 then\n            aura_env.counter = 0\n            local state = allstates[destGUID]\n            if state then\n                state.show = false\n                state.changed = true\n                return true\n            end\n        end\n    end\n    if event == \"ENCOUNTER_START\" then\n        aura_env.counter = 0\n    end\n    if event == \"RAID_TARGET_UPDATE\" then\n        for k,v in pairs(allstate